import React, { Fragment } from 'react';

const Formulario = () => {
    return ( 
        <Fragment>    
            <h2>Crear Cita</h2>

            <form>
                <label>Nombre mascota</label>
                <input
                    type="text"
                    name="mascota"
                    clasName="u-full-width"
                    placeholder="Nombre Mascota"
                />

            </form>

        </Fragment>
    );
    
    
}

export default Formulario;
